import React from "react";

const Main = () => {
    return(
        <div className="main">
            <div className="main__head-container">
                <h1 className="main__title">TITLE</h1>
                <div className="main__info-container">
                    <h2 className="main__info-container--author">Channel</h2>
                    <h2 className="main__info-container--date">Timestamp</h2>
                </div>
                <div className="main__views-likes-container"></div>
            </div>
            <div className="main__description-container">
                <p className="main__description-container--content"></p>
            </div>

        </div>
    )
}

export default Main;
